function App(){
    const name = "dawood";
    return(
        <div>
            <h1>hello {name}</h1>
            <Header/>
            <Content/>
        </div>
            
    )
}
function Header(){
    return(
        <h2>this is header</h2>
    )
}
function Content(){
    return(
        <p>writing from content component</p>
    )
}

export default App;
